DROP SCHEMA IF EXISTS t_19_playlist;
CREATE SCHEMA IF NOT EXISTS t_19_playlist;
USE t_19_playlist;

CREATE TABLE tracks (
   id   INT NOT NULL PRIMARY KEY AUTO_INCREMENT, 
   name VARCHAR(200) NOT NULL,
   artist VARCHAR(100),
   album VARCHAR(100),
   duration DOUBLE NOT NULL,
   release_date DATETIME,
   inserted_by VARCHAR(100),
   tribo VARCHAR(100)
);

